import './App.css';
import Home from './components/Home';
import NavBar from './components/Navbar'; 
import AboutUs from './components/Aboutus';
import RecipesByArea from './components/RecipesByArea'; 
import Login from './components/Login';
import Register from './components/Register';
import NorthIndian from './components/NorthIndian';
import SouthIndian from './components/SouthIndian';
import Continental from './components/Continental';
import Recipe from './components/Recipe';
import RecipeInfo from './components/RecipeInfo'; // Import RecipeInfo component

import { createBrowserRouter, RouterProvider } from 'react-router-dom';

const router = createBrowserRouter([
  {
    path: '/',
    element: (
      <>
        <NavBar />
        <Home />
      </>
    ),
  },
  {
    path: '/about',
    element: (
      <>
        <NavBar />
        <AboutUs />
      </>
    ),
  },
  {
    path: '/recipes/:area',
    element: (
      <>
        <NavBar />
        <RecipesByArea />
      </>
    ),
  },
  {
    path: '/recipeinfo//:id',
    element: (
      <>
        <NavBar />
        <RecipeInfo />
      </>
    ),
  },
  {
    path: '/login',
    element: (
      <>
        <NavBar />
        <Login />
      </>
    ),
  },
  {
    path: '/register',
    element: (
      <>
        <NavBar />
        <Register />
      </>
    ),
  },
  {
    path: '/north',
    element: (
      <>
        <NavBar />
        <NorthIndian />
      </>
    ),
  },
  {
    path: '/south',
    element: (
      <>
        <NavBar />
        <SouthIndian />
      </>
    ),
  },
  {
    path: '/Continental',
    element: (
      <>
        <NavBar />
        <Continental />
      </>
    ),
  },
  {
    path: '/Recipe',
    element: (
      <>
        <NavBar />
        <Recipe />
      </>
    ),
  },
  {
    path: '/recipeinfo/:id', // New route for RecipeInfo
    element: (
      <>
        <NavBar />
        <RecipeInfo />
      </>
    ),
  },
]);

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
